export const Temporadas=({temporadas})=>{

    const getTemporadas = ["T0", "T1", "T2", "T3", "T4", "T5", "T6", "T7", "T8"];

     console.log(temporadas.length)
     for(var i=0;i<temporadas.length;i++){

       // getTemporadas.push('T'+i);
     }

     console.log(getTemporadas)

    const listItems = getTemporadas.map((number) =>
        <div className='container-11'>
            <p className='text1'>{number}</p>
        </div>
     );

    return(
       <div style={{display:'flex'}}> 
        {listItems}
       </div>
    )
}


